import React from "react";

export default function Fitness(){
    return(
        <div>
           <h1>FIND YOUR FITNESS SOLUTION</h1>
              <div className="fitness--wrapper">
                    <div className="fitness--goal">
                        <img src="images/yoga.png" alt="" />
                    </div>
                
              </div>

        </div>
    )
}
